import Vue from 'vue';
import VueRouter from 'vue-router'
import BookList from "./components/bookList.vue";
import BookView from "./components/book.vue";

Vue.use(VueRouter);

const routes = [
    {
        name: "BookList",
        component: BookList,
        path: "/"
    },
    {
        name: "BookView",
        component: BookView,
        path: "/books"
    },

];

const router = new VueRouter({
    routes,
    mode: "history",
});

export default router;
